const fz = require('zigbee-herdsman-converters/converters/fromZigbee');
const tz = require('zigbee-herdsman-converters/converters/toZigbee');
const exposes = require('zigbee-herdsman-converters/lib/exposes');
const reporting = require('zigbee-herdsman-converters/lib/reporting');
const e = exposes.presets;
const ea = exposes.access;
const {precisionRound} = require('zigbee-herdsman-converters/lib/utils');

const tzLocal = {
    node_config: {
        key: ['reading_interval', 'tx_radio_power', 'tds_offset'],
        convertSet: async (entity, key, rawValue, meta) => {
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                reading_interval: ['genBasic', {0x0201: {value, type: 0x23}}],
				tx_radio_power: ['genBasic', {0x0236: {value, type: 0x28}}],
				tds_offset: ['genBasic', {0x0556: {value, type: 0x39}}],
            };
            await entity.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	node_config10: {
        key: ['ecCalibration', 'tCalibration'],
        convertSet: async (entity, key, rawValue, meta) => {
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            //const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
			const value = parseFloat(rawValue);
            const payloads = {
				ecCalibration: ['genBasic', {0x0557: {value, type: 0x39}}],
				tCalibration: ['genBasic', {0x0558: {value, type: 0x39}}],
            };
            await entity.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	temperaturef_config: {
        key: ['temperature_offset'],
        convertSet: async (entity, key, rawValue, meta) => {
            const value = parseFloat(rawValue)*10;
            const payloads = {
                temperature_offset: ['msTemperatureMeasurement', {0x0210: {value, type: 0x29}}],
            };
            await entity.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
};

const fzLocal = {
    node_config: {
        cluster: 'genBasic',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0201)) {
                result.reading_interval = msg.data[0x0201];
            }
			if (msg.data.hasOwnProperty(0x0236)) {
                result.tx_radio_power = msg.data[0x0236];
            }
			if (msg.data.hasOwnProperty(0x0555)) {
				result.tds = precisionRound(msg.data[0x0555], 1);
            }
			if (msg.data.hasOwnProperty(0x0556)) {
                result.tds_offset = parseFloat(msg.data[0x0556]);
            }
			if (msg.data.hasOwnProperty(0x0557)) {
                result.ecCalibration = precisionRound(msg.data[0x0557], 2);
            }
			if (msg.data.hasOwnProperty(0x0558)) {
                result.tCalibration = precisionRound(msg.data[0x0558], 3);
            }
            return result;
        },
    },
	temperaturef_config: {
        cluster: 'msTemperatureMeasurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0210)) {
                result.temperature_offset = parseFloat(msg.data[0x0210])/10.0;
            }
			if (msg.data.hasOwnProperty(0xA19B)) {
                result.ds18b20_identifier = msg.data[0xA19B];
            }
            return result;
        },
    },
};

const definition = {
        zigbeeModel: ['EFEKTA_TDS_Monitor'],
        model: 'EFEKTA_TDS_Monitor',
        vendor: 'EfektaLab',
        description: 'EFEKTA TDS Monitor.',
        fromZigbee: [fz.temperature, fzLocal.node_config, fzLocal.temperaturef_config],
        toZigbee: [tz.factory_reset, tzLocal.temperaturef_config, tzLocal.node_config, tzLocal.node_config2, tzLocal.node_config10],
        configure: async (device, coordinatorEndpoint, logger) => {
            const endpointOne = device.getEndpoint(1);
            await reporting.bind(endpointOne, coordinatorEndpoint, ['genBasic', 'msTemperatureMeasurement']);
			const payload1 = [{attribute: {ID: 0x0555, type: 0x39},
            minimumReportInterval: 10, maximumReportInterval: 300, reportableChange: 0}];
            await endpointOne.configureReporting('genBasic', payload1);
            const payload2 = [{attribute: {ID: 0x0000, type: 0x29},
            minimumReportInterval: 10, maximumReportInterval: 600, reportableChange: 10}];
            await endpointOne.configureReporting('msTemperatureMeasurement', payload2);
        },
        icon: 'data:image/png;base64,',
		exposes: [exposes.numeric('tds', ea.STATE).withUnit('ppm').withDescription('TDS'),
		    exposes.numeric('ecCalibration', ea.STATE_SET).withUnit('unit').withValueStep(0.01).withDescription('EC calibration').withValueMin(-10.00).withValueMax(10.00),
			exposes.numeric('tCalibration', ea.STATE_SET).withUnit('unit').withValueStep(0.001).withDescription('Temperarure calibration').withValueMin(-10.00).withValueMax(10.00),
		    e.temperature(),
			exposes.numeric('ds18b20_identifier', ea.STATE).withDescription('DS18B20 identifier'),
		    exposes.numeric('reading_interval', ea.STATE_SET).withUnit('Seconds').withDescription('Setting the sensor reading interval. Setting the time in seconds, by default 30 seconds')
                .withValueMin(10).withValueMax(360),
			exposes.numeric('tds_offset', ea.STATE_SET).withUnit('ppm').withValueStep(0.1).withDescription('Adjust TDS')
                .withValueMin(-100.0).withValueMax(100.0),
			exposes.enum('tx_radio_power', ea.STATE_SET, [0, 4, 10, 19]).withDescription('Set TX Radio Power, dbm)'),
			exposes.numeric('temperature_offset', ea.STATE_SET).withUnit('C').withValueStep(0.1).withDescription('Adjust temperature')
                .withValueMin(-50.0).withValueMax(50.0)],
};

module.exports = definition;